import { Link } from "react-router-dom";
import "../styles/Organizations.css"

const Organizations = () => {
    const profile = 6;


    return (
        <div className="organizationsPage">
            <Link to={`profile/${profile}`} style={{ textDecoration: "none" }}>
                <div className="card mb-3" style={{maxWidth: '90vw'}}>
                    <div className="col-md-4">
                    <img src="" className="img-fluid rounded-start" alt="Фото"/>
                    </div>
                    <div className="col-md-8">
                    <div className="card-body">
                        {/* {props.event.FIO
                            ?
                            <h5 className="card-title">{props.event.FIO}</h5>
                            :
                            <h5 className="card-title">{props.event.name_organization}</h5>
                        }  */}
                    </div>
                    </div>
                </div>
            </Link>
        </div>
    );
}

export default Organizations;
